import React from "react";
import Car from "./car";

interface CardsProps {
  IDs: number[];
}

function Cards(props: CardsProps) {
  return (
    <div className="cards">
      {props.IDs.map((ID: number) => (
        <Card id={ID} />
      ))}
    </div>
  );
}

export default Cards;
